COPY public.hdb_unit_types (id, description) FROM stdin;
1room     	A studio flat in which the bedroom, sitting-room and kitchen are all one-room.
2room     	This is an affordable housing option for lower-income households, seniors, and singles.
3room     	For a compact living space that caters well to living needs, a 3-room flat will be ideal.
4room     	4-room flats are ideal for young couples or parents.
5room     	The 5-room flats are great for larger households of 5 or more members.
executive 	Executive flats feature an additional space for a study that can be easily converted into a cosy living room or TV nook. Some Executive flats also have a balcony space for added alfresco enjoyment.
multigen  	Eligible multi-generation families living under one roof in a 3Gen flat can delight in closer family ties. With 2 bedrooms with attached bathrooms, and 2 other bedrooms, a 3Gen flat supports the needs of extended families.
studio    	 Studio apartments are similar in layout and sizes to 2-room flats but have different lease periods (30 years insead of 99 years) and cannot be resold on the open market.
other     	HDB units that do not fall under any other category.
